<!DOCTYPE html>
<html>
   <header>
      <title>h5imgui</title>
      <meta name="viewport" content="width=device-width,initial-scale=1.0,user-scalable=no" />
      <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
      <script src="https://fastly.jsdelivr.net/npm/vue@3"></script>
      <script src="https://fastly.jsdelivr.net/npm/vant@4/lib/vant.min.js"></script>
      <link rel="stylesheet" href="https://unplug.com/element-ui@2.15.7/lib/theme-chalk/index.css" />
      <link rel="stylesheet" href="https://unpkg.com/vant@2.12/lib/index.css" />
      <link rel="stylesheet" href="index.css" />
      <script src="https://cdn.jsdelivr.net/npm/vue@2.6/dist/vue.min.js"></script>
      <script src="https://unpkg.com/element-ui@2.15.7/lib/index.js"></script>
      <link rel="preconnect" href="https://fonts.googleapis.com" />
      <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
      <script src="https://unpkg.com/vant@2.12/lib/vant.min.js"></script>
      <link href="https://fonts.googleapis.com/css2?family=Noto+Sans+TC:wght@700&display=swap" rel="stylesheet" />
      <link rel="stylesheet" href="index.css" />
      <style>
         * {
         --color-a: rgba(255, 255, 255, 0.83);
         -webkit-touch-callout: none;
         -webkit-user-select: none;
         user-select: none;
         outline: none;
         -webkit-tap-highlight-color: transparent;
         padding: 0;
         margin: 0;
         color: #323233;
         font-family: "Noto Sans TC", sans-serif;
          transition: filter 300ms;
         }
         .ayimgui {
         box-shadow: 0 0 15px rgba(255, 255, 255, 0.83) inset,
         0 0 10px rgba(189, 188, 188, 0.83);
         position: fixed;
         width: 250px;
         height: 2000px;
         top: calc(50% - 180px);
         left: calc(50% - 180px);
         border-radius: 10px;
         overflow: hidden;
         -webkit-user-select: none;
         -moz-user-select: none;
         -ms-user-select: none;
         user-select: none;
         }
         .onlyTitle {
         height: 28px !important;
         }
         .ayimgui .aytitle {
         padding: 2px;
         font-size: 16px;
         background-color: rgba(255, 255, 255,
         0.83);
         }
         .ayimgui .aytitle .titleClose {
         position: relative;
         top: 3px;
         right: 6px;
         color: #fff;
         }
         .ayimgui .aytitle .titleClose:hover {
         color: #409eff;
         }
         .ayimgui .aybody {
         position: relative;
         z-index: 1;
         padding: 15px;
         height: calc(100% - 21px - 15px - 15px);
         overflow: auto;
         font-size: 14px;
         background-color: rgba(242, 241, 246, 0.7);
         }
         .aytext {
         width: 100%;
         margin-bottom: 10px;
         display: flex;
         flex-direction: column;
         justify-content: space-around;
         color: #fff;
         }
		#hidd {
			width: 250px;
			height: 12px;
			position: absolute;
			bottom: 0px;
         left: 10px;
         background-color: #000000;
			text-align: center;
         margin: auto;
		}

         /*checkbox*/
         .imgui-checkbox input[type="checkbox"] {
         display: none;
         padding-left: 10px;
         }
         .imgui-checkbox input[type="checkbox"]:checked+.imgui-checkmark::after {
         opacity: 1;
         }
         .imgui-checkmark {
         min-width: 100px;
         display: inline-block;
         padding: 0px 0px 0px 28px;
         position: relative;
         }
         .imgui-mainwindow {
         color: rgba(229.5, 229.5, 229.5, 1);
         caret-color: rgba(229.5, 229.5, 229.5, 1);
         background-color: rgba(0, 0, 0, 0.85);
         user-select: none;
         -webkit-user-select: none;
         -webkit-tap-highlight-color: transparent;
         width: 640px;
         white-space: nowrap;
         resize: both;
         overflow: auto;
         border: 1px solid rgba(127.5, 127.5, 127.5, 0.5);
         }
         .imgui-checkmark::after {
         content: "";
         display: inline-block;
         position: absolute;
         width: 13px;
         padding-top: 6px;
         top: 6px;
         left: 4px;
         border: solid #1989fa;
         border-width: 0px 0px 3px 3px;
         transform: rotate(-50deg);
         opacity: 0;
         }
         .imgui-checkmark::before {
         content: "";
         display: inline-block;
         position: absolute;
         width: 22px;
         height: 22px;
         top: 0;
         left: 0;
         background-color: rgba(109.64999999999999,
         109.64999999999999,
         109.64999999999999,
         0.39);
         border: 1px solid rgba(127.5, 127.5, 127.5, 0.5);
         }
         /* 解决ios下拉需要点两次 */
         .el-scrollbar .el-scrollbar__bar {
         opacity: 1 !important;
         }
         .el-button {
         border-radius: 5px;
         margin: 5px;
         font-size: 14px;
         padding: 7px 10px;
         line-height: 14px;
         color: #fff;
         background-color: rgba(255, 255, 255, 0.83);
         border: 1px solid #d1d1d1;
         box-shadow: 0 0 0px #d1d1d1 inset, 0 0 5px #d1d1d1;
         }
         .el-button:focus,
         .el-button:hover {
         color: #fff;
         background-color: #387aca;
         }
         /*color font*/
         .colorcc {
         animation: color-change 5s infinite;
         }
         .colorcc1 {
         animation: color-change1 5s infinite;
         }
         .colorcc2 {
         animation: color-change2 5s infinite;
         }
         .colorcc3 {
         animation: color-change3 5s infinite;
         }
         .rainbow-text {
         display: inline-block;
         }
         @keyframes color-change {
         0%,
         100% {
         color: #ff7675;
         }
         25% {
         color: #74b9ff;
         }
         50% {
         color: #55efc4;
         }
         75% {
         color: #ffeaa7;
         }
         }
         @keyframes color-change1 {
         0%,
         100% {
         color: #ffeaa7;
         }
         25% {
         color: #55efc4;
         }
         50% {
         color: #74b9ff;
         }
         75% {
         color: #ff7675;
         }
         }
         @keyframes color-change2 {
         0%,
         100% {
         color: #74b9ff;
         }
         25% {
         color: #ff7675;
         }
         50% {
         color: #ffeaa7;
         }
         75% {
         color: #55efc4;
         }
         }
         @keyframes color-change3 {
         0%,
         100% {
         color: #55efc4;
         }
         25% {
         color: #ffeaa7;
         }
         50% {
         color: #ff7675;
         }
         75% {
         color: #74b9ff;
         }
         }
         .rainbow {
         animation: rainbow 1s linear infinite;
         }
         .aytab {
         width: 100%;
         height: 20px;
         display: flex;
         border-bottom: 2px solid #387ccc;
         }
         .aytab span {
         padding: 0 5px;
         height: 100%;
         display: flex;
         align-items: center;
         justify-content: center;
         background-color: #25456d;
         color: #fff;
         font-size: 14px;
         font-weight: 500;
         margin-left: 10px;
         border-radius: 6px 6px 0 0;
         cursor: pointer;
         }
         .imgui-radiobutton:hover {
         background-color: rgba(66.3, 150.45, 249.9, 0.4);
         }
         .imgui-radiobutton {
         -webkit-appearance: none;
         appearance: none;
         position: relative;
         width: 20px;
         height: 20px;
         background-color: rgba(40.800000000000004,
         73.94999999999999,
         122.39999999999999,
         0.54);
         border: 1px solid rgba(109.64999999999999, 109.64999999999999, 127.5, 0.5);
         border-radius: 50%;
         vertical-align: -0.5rem;
         margin-top: 5px;
         }
         .imgui-radiobutton:checked:before {
         position: absolute;
         top: 50%;
         left: 50%;
         transform: translate(-50%, -50%);
         width: 10px;
         height: 10px;
         border-radius: 50%;
         background: rgba(66.3, 150.45, 249.9, 0.67);
         content: "";
         }
         .el-input input {
         background-color: #ffffff;
         border: none;
         border-radius: 0px;
         color: #000000;
         }
         .gameinfo {
         display: flex;
         align-items: center;
         }
         .gameinfo .left {
         width: 50%;
         display: flex;
         }
         .gameinfo .left .left {
         display: flex;
         font-size: 10px;
         }
         .gameinfo .left .right {
         margin-top: 5px;
         margin-left: -40px;
         font-size: 13px;
         }
         .gameinfo .right1 {
         margin-left: 5px;
         width: 50%;
         }
         .gameinfo .right1 .fo {
         margin-left: 6px;
         }
         .gameinfo .right1 .bu {
         display: flex;
         margin-top: 15px;
         }
         .v-line {
         border-left: 2px solid #ffffff;
         height: 80px;
         left: 50%;
         }
         .gameinfo .right1 .van-button {
         text-shadow: 0 0 40px white;
         color: #000;
         margin-left: 10px;
         }
         .footer-text {
         color: rgb(26, 25, 25);
         font-size: 15px;
         text-shadow: 0 0 5px rgb(0, 0, 0);
         opacity: 0;
         animation: fadeInOut 2s linear infinite;
         user-select: none;
         }
         @keyframes fadeInOut {
         0%,
         100% {
         opacity: 0;
         }
         50% {
         opacity: 1;
         }
         }
         hr {
         margin: 10px;
         }
         canvas {
         position: absolute;
         z-index: -1;
         }
      </style>
   </header>
<div id="hidd">
</div>

   <script>
      window.alert = function (name) {
          var iframe = document.createElement("IFRAME");
          iframe.style.display = "none";
          iframe.setAttribute("src", "data:text/plain,");
          document.documentElement.appendChild(iframe);
          window.frames[0].window.alert(name);
          iframe.parentNode.removeChild(iframe);
      };
      
      //重写confirm 不显示ip地址
      var wConfirm = window.confirm;
      window.confirm = function (message) {
          try {
              var iframe = document.createElement("IFRAME");
              iframe.style.display = "none";
              iframe.setAttribute("src", "data:text/plain,");
              document.documentElement.appendChild(iframe);
              var alertFrame = window.frames[0];
              var iwindow = alertFrame.window;
              if (iwindow == undefined) {
                  iwindow = alertFrame.contentWindow;
              }
              var result = iwindow.confirm(message);
              iframe.parentNode.removeChild(iframe);
              return result;
          } catch (exc) {
              return wConfirm(message);
          }
      };

   </script>
   <script>

      
      function fun(e) {
          var t = new Date(),
              n = t.getFullYear(),
              g = t.getMonth() + 1,
              a = t.getDate(),
              i =
              (t.getDay(),
                  "日一二三四五六".charAt(new Date().getDay()),
                  t.getHours()),
              o = t.getMinutes(),
              s = t.getSeconds(),
              u = t.getMilliseconds();
          g < 10 && (g = "0" + g),
              a < 10 && (a = "0" + a),
              i < 10 && (i = "0" + i),
              o < 10 && (o = "0" + o),
              s < 10 && (s = "0" + s),
              u < 10 ? (u = "00" + u) : u < 100 && (u = "0" + u),
              (document.getElementById(e.id).innerHTML =
                  n + "-" + g + "-" + a + " " + i + ":" + o + ":" + s + " ");
      }
      setInterval("fun(show_time)", 1);


   </script>

              return {
                  result: [],

                  ifshow: true,
      
                  bscard: "",

                  check: true,
                  bsgg: "暂无公告",

                  bsok: false,
                  // 到期时间
                  expires: "9999年12月31日\x2000:00:00",
              };
          },
          mounted() {
              const button = this.$refs.startButton;
              this.getCard();
              this.setRect(550, 300);
              //竖屏

              var sHeight = window.screen.height; //屏幕高
              //全屏显示
              if (window.screen.availWidth > window.screen.availHeight) {
                  //横屏，宽高置换
                  sWidth = window.screen.height; //屏幕宽
                  sHeight = window.screen.width; //屏幕高
              }
              setWindowRect(0, 0, sWidth, sHeight);
              setButtonAction(function () {
                  var menu = document.querySelector("#app");
                    if (menu.style.filter === 'opacity(1)') {
                        setWindowTouch(false)
                        menu.style.filter = 'opacity(0)'
                    } 
                    else {
                        setWindowTouch(true)
                        menu.style.filter = 'opacity(1)'
                    }
                });
            },
                     
          methods: {
              getCard() {
                  this.bscard = localStorage.getItem("wig_km");
              },
              enter() {
                  if (this.bscard) {
                      try {
                        
                        this.bsok = true;
                      } catch (error) {
                          
                          this.bsok = false;
                      }
                  } else {
                    alert("Success")
                    this.bsok = true;
                  }
              },

                  if (this.bscard) {
                      try {
                          const {

                          this.expires = expires;
                          alert(`${expires}`);
                          localStorage.setItem("wig_km", this.bscard);
                          console.log(`${expires}`);
                          this.bsok = true;
                      } catch (error) {
                          console.log(error.msg);
                          alert(error.msg);
                          this.bsok = false;
                      }
                  } else {
                      alert("Please Enter The KEY");
                  }
              },

                  ayMenu.style.height = `${boxH}px`;

                  if (y == -1) ayMenu.style.top = `calc(50% - ${boxH / 2}px)`;

                  this.menuLastX = ayMenu.offsetLeft;

const iosScale = window.devicePixelRatio;
let sWidth = window.screen.width * iosScale;
let sHeight = window.screen.height * iosScale;

let EntityArray = new Array();

const baseAddr = Number(h5gg.getRangesList(0)[0].start);

function initializeScreen() {
    if (Math.abs(window.orientation) === 90) {
        sWidth = window.screen.height * iosScale;
        sHeight = window.screen.width * iosScale;
    }
    ESPCanvas.width = sWidth;
    ESPCanvas.height = sHeight;
    ESPCanvas.style.height = "100%";
    ESPCanvas.style.width = "100%";
    ESPCanvas.style.pointerEvents = "none";
    ESPCanvas.style.zIndex = 999;
    ESPCanvas.style.position = "fixed";
    ESPCanvas.style.top = "0px";
    ESPCanvas.style.left = "0px";
    document.documentElement.insertBefore(ESPCanvas, document.documentElement.firstChild);
}

function initializeH5GG() {
    setWindowRect(0, 0, sWidth / iosScale, sHeight / iosScale);
    setWindowTouch(false);
}

function initializeEntityList() {//坐標
h5gg.clearResults();
h5gg.searchNumber('10', 'I64', '0x280000000', '0x287000000');
    const Count = h5gg.getResultsCount();
    const Results = h5gg.getResults(Count);
    EntityArray = [];
    for (let i = 0; i < Count; i++) {
if (h5gg.getValue(Number(Results[i].address) - 0x4, 'I32') == 2 &&
h5gg.getValue(Number(Results[i].address) + 0x8, 'I32') == 1)
{
EntityArray.push(Number(Results[i].address) - 0x18);
h5gg.clearResults();
}
}
}


function Render() {
    const D = new Draw();
    D.Clear();
    let _ViewMatrix = readPointer(baseAddr + 0x5EA8ED8);
    const Matrix = new ViewMatrix(_ViewMatrix + 0x368);//矩陣


let LocalPlayer = readPointer(baseAddr + 0x6266E50);
    LocalPlayer = readPointer(LocalPlayer + 0x40);
    const playerCameraManager = (LocalPlayer + 0x7c);//自身坐標


    let ClosestActor;
    let ClosestActorPos;
    let ClosestDistance = 999;
    let Fov = 0;

    for (let i = 0; i < EntityArray.length; i++) {

        const actor = EntityArray[i];
                var bDead = readInt(actor + 0x30)
                if (bDead != 1065353216) continue;
                var fuck = readInt(actor + 0x14)
                if (fuck != 2) continue;
        const LocalPos = new Vec3(
            h5gg.getValue(playerCameraManager, "F32"),//自身坐標x
            h5gg.getValue(playerCameraManager + 0x4, "F32"),//自身坐標y
            h5gg.getValue(playerCameraManager + 0x8, "F32")//自身坐標z
        );//0xC=?





        const topPos = new Vec3(
            h5gg.getValue(actor + 0x0, "F32"),//坐標X
            Number(h5gg.getValue(actor + 0x4, "F32")) + 1,//坐標Y
            h5gg.getValue(actor + 0x8, "F32")
        );//坐標Z

        ;



                if (Distance3D(LocalPos, topPos) < 3) continue;
const bottomPos = new Vec3(
            h5gg.getValue(actor + 0x0, "F32"),//坐標X
            Number(h5gg.getValue(actor + 0x4, "F32")) - 0.75,//坐標Y
            h5gg.getValue(actor + 0x8, "F32")//坐標Z
        );

        const reT = WorldToScren2(topPos, Matrix);
        const reB = WorldToScren2(bottomPos, Matrix);
        const reH = reB.y - reT.y;
        const reW = reH / 2;//方框寬度

        D.Line(reT.x, reT.y, sWidth / 2, 50);
        D.Rect(reT.x - reW / 2, reT.y, reW, reH, "#05ff05", false);


        const Distance = Distance2D(new Vec2(sWidth / 2, sHeight / 2), reT);

        if (Distance < ClosestDistance && Distance < Fov * iosScale) {
            ClosestDistance = Distance;
            ClosestActor = actor;
            ClosestActorPos = topPos;
        }

    }



    if (ClosestActor) {

        const reT = WorldToScren2(ClosestActorPos, Matrix);
        D.Line(reT.x, reT.y, sWidth / 2, sHeight / 2, "#FFFFFF");
        //D.Text(`0x${ClosestActor.toString(16)}`, sWidth / 2, 350, 30, "blue");

        const LocalPos = new Vec3(
            h5gg.getValue(playerCameraManager + 0x0, "F32"),//自身X
            h5gg.getValue(playerCameraManager + 0x4, "F32"),//自身Y
            h5gg.getValue(playerCameraManager + 0x8, "F32")//自身Z
        );
}


    D.Circle(sWidth / 2, sHeight / 2, Fov, "#ff0000", false);//圓圈
    D.Text(`Knives Out`, sWidth / 2 + 3, 50 + 3, 30, "white");//人物計數
    D.Text(`Knives Out`, sWidth / 2, 50, 30, "red");


    requestAnimationFrame(Render);
}

class Draw {
    constructor() {
        this.ctx = ESPCanvas.getContext("2d");
    }

    Clear() {
        this.ctx.clearRect(0, 0, sWidth * iosScale, sHeight * iosScale);
    }

    Line(x1, y1, x2, y2, color = "#FFFFFF", lineWidth = 1.2) {
        this.ctx.beginPath();
        this.ctx.strokeStyle = color;
        this.ctx.moveTo(x1, y1);
        this.ctx.lineTo(x2, y2);
        this.ctx.lineWidth = iosScale * lineWidth;
        this.ctx.stroke();
        this.ctx.closePath();
    }

    Circle(x, y, r = 20, color = "red", isFill = true, lineWidth = 1) {
        r *= iosScale;
        this.ctx.beginPath();
        this.ctx.lineWidth = iosScale * lineWidth;
        this.ctx.strokeStyle = color;
        this.ctx.fillStyle = color;
        this.ctx.arc(x, y, r, 0, 2 * Math.PI);
        if (isFill) {
            this.ctx.fill();
        } else {
            this.ctx.stroke();
        }
        this.ctx.closePath();
    }

    Rect(x, y, w = 1, h = 1, color = "red", isFill = true, lineWidth = 1) {
        this.ctx.beginPath();
        this.ctx.lineWidth = iosScale * lineWidth;
        this.ctx.strokeStyle = color;
        this.ctx.fillStyle = color;
        if (isFill) {
            this.ctx.fillRect(x, y, w, h);
        } else {
            this.ctx.strokeRect(x, y, w, h);
        }
        this.ctx.closePath();
    }

    Text(text, x, y, size = 10, color = "red", isFill = true) {
        size *= iosScale;
        this.ctx.beginPath();
        this.ctx.textAlign = "center";
        this.ctx.fillStyle = color;
        this.ctx.strokeStyle = color;
        this.ctx.font = size + "px Arial";
        if (isFill) {
            this.ctx.fillText(text, x, y + size);
        } else {
            this.ctx.strokeText(text, x, y + size);
        }
        this.ctx.closePath();
    };

    HPBar(x, y, size = 10, hp = 50, maxHp = 100) {
        const w = size * 10;
        const h = w / 10;
        x = x - w / 2;
        this.ctx.fillStyle = "#000";
        this.ctx.fillRect(x, y, w, h);
        const hpWidth = (hp / maxHp) * w;
        const ratio = hp / maxHp;
        const red = Math.round(255 * (1 - ratio));
        const green = Math.round(255 * ratio);
        const barColor = `rgb(${red}, ${green}, 0)`;
        this.ctx.fillStyle = barColor;
        this.ctx.fillRect(x, y, hpWidth, h);
        this.ctx.strokeStyle = "#FFF";
        this.ctx.lineWidth = 1;
        this.ctx.strokeRect(x, y, w, h);
    }
}

class Vec2 {
    constructor(x = 0, y = 0) {
        this.x = x;
        this.y = y;
    }
}

class Vec3 {
    constructor(x = 0, y = 0, z = 0) {
        this.x = x;
        this.y = y;
        this.z = z;
    }
}

class Vec4 {
    constructor(x = 0, y = 0, z = 0, w = 0) {
        this.x = x;
        this.y = y;
        this.z = z;
        this.w = w;
    }
}

class ViewMatrix {
    constructor(Address) {
        this.Matrix = new Float32Array(16).fill(0);
        for (let i = 0; i < 16; i++) {
            this[i] = Number(h5gg.getValue(Address + i * 4, "F32"));
        }
    }
}

function WorldToScren(Pos, Matrix) {
    let Result = new Vec2();
    let clipCoords = new Vec4();

    clipCoords.x = Pos.x * Matrix[0] + Pos.y * Matrix[4] + Pos.z * Matrix[8] + Matrix[12];
    clipCoords.y = Pos.x * Matrix[1] + Pos.y * Matrix[5] + Pos.z * Matrix[9] + Matrix[13];
    clipCoords.z = Pos.x * Matrix[2] + Pos.y * Matrix[6] + Pos.z * Matrix[10] + Matrix[14];
    clipCoords.w = Pos.x * Matrix[3] + Pos.y * Matrix[7] + Pos.z * Matrix[11] + Matrix[15];


    if (clipCoords.w < 1.0) {
        clipCoords.w = 1.0;
    }

    let TransformedCoords = new Vec3();
    TransformedCoords.x = clipCoords.x / clipCoords.w;
    TransformedCoords.y = clipCoords.y / clipCoords.w;
    TransformedCoords.z = clipCoords.z / clipCoords.w;

    Result.x = (sWidth / 2 * TransformedCoords.x) + (sWidth / 2);
    Result.y = -(sHeight / 2 * TransformedCoords.y) + (sHeight / 2);

    return Result;
}

function WorldToScren2(Pos, Matrix) {
    let Result = new Vec2();
    let TransformedCoords = new Vec4();
    TransformedCoords.x = Matrix[0] * Pos.x + Matrix[1] * Pos.y + Matrix[2] * Pos.z + Matrix[3];
    TransformedCoords.y = Matrix[4] * Pos.x + Matrix[5] * Pos.y + Matrix[6] * Pos.z + Matrix[7];
    TransformedCoords.z = Matrix[8] * Pos.x + Matrix[9] * Pos.y + Matrix[10] * Pos.z + Matrix[11];
    TransformedCoords.w = Matrix[12] * Pos.x + Matrix[13] * Pos.y + Matrix[14] * Pos.z + Matrix[15];

    if (TransformedCoords.w >= 0.01) TransformedCoords.w = 1.0 / TransformedCoords.w;
    TransformedCoords.x *= TransformedCoords.w;
    TransformedCoords.y *= TransformedCoords.w;

    Result.x = sWidth * (TransformedCoords.x * 0.5 + 0.5);
    Result.y = sHeight * (0.5 - TransformedCoords.y * 0.5);

    return Result;
}


function Distance1D(x, y) {
    return Math.sqrt(Math.pow(x, 2) + Math.pow(y, 2));
}

function Distance2D(Position1, Position2) {
    let Difference = new Vec2();
    Difference.x = Position1.x - Position2.x;
    Difference.y = Position1.y - Position2.y;
    return Math.sqrt(Math.pow(Difference.x, 2) + Math.pow(Difference.y, 2));
}

function Distance3D(Position1, Position2) {
    let Difference = new Vec3();
    Difference.x = Position1.x - Position2.x;
    Difference.y = Position1.y - Position2.y;
    Difference.z = Position1.z - Position2.z;
    return Math.sqrt(Math.pow(Difference.x, 2) + Math.pow(Difference.y, 2) + Math.pow(Difference.z, 2));
}

function GetAngle(Position1, Position2) {
    let Result = new Vec3();

    const difference = new Vec3(
        Position2.x - Position1.x,
        Position2.y - Position1.y,
        Position2.z - Position1.z,
    );

    Result.x = Math.atan2(difference.z, Distance1D(difference.x, difference.y)) * (360 / Math.PI);
    Result.y = Math.atan2(difference.y, difference.x) * (360 / Math.PI);
    Result.z = Math.atan2(Distance1D(difference.x, difference.y), difference.z) * (360 / Math.PI);

    return Result;
}

function GetAngle2(Position1, Position2) {
    let Result = new Vec3();

    const Difference = new Vec3(
        Position1.x - Position2.x,
        Position1.y - Position2.y,
        Position1.z - Position2.z,
    );
    const Distance = Distance3D(Position1, Position2);
    Result.x = Difference.x / Distance;
    Result.y = Difference.y / Distance;
    Result.z = Difference.z / Distance;

    return Result;
}

    if (isNull(Addr)) return baseAddr;
    return Number(h5gg.getValue(Addr, "U64"));
